import React from "react";
import { useState, useEffect } from "react";
const AddToCart = () => {
  let [user, setUser] = useState([]);
  useEffect(() => {
    fetch("http://localhost:4000/cart")
      .then((data) => data.json())
      .then((elem) => setUser(elem));
  });

  let deleteBook = (id) => {
    console.log(id);
    fetch(`http://localhost:4000/cart/${id}`, { method: "DELETE" });
  };

  return (
    <div>
    <h3>User Details</h3>

    {user.length === 0 ? (
      <div>
        <p>No Cart  Found </p>
        <Link to="/adminportal/addusers">
          <button>Add User</button>
        </Link>
      </div>
    ) : (
      <div>
        <table>
          <tr>
            <th>Id</th>
            <th>No</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>State</th>
            <th>Number</th>
            <th>DOB</th>
            <th>View</th>
            <th>Password</th>
            <th>Delete</th>
          </tr>
          {user.map((elem, index) => {
            let { id, title, isbn, pageCount, thumbnailUrl, status, authors ,categories} = elem;
            return (
              <tr>
                <td>{id}</td>
                <td>{index + 1}</td>
                <td>{FirstName}</td>
                <td>{LastName}</td>
                <td>{Email}</td>
                <td>{State}</td>
                <td>{Number}</td>
                <td>{DOB}</td>
                {/* <td>
                  <button onClick={() => viewDetails(id)}>View</button>
                </td>
                <td>sourav</td> */}
                <td>
                  <button onClick={() => deleteBook(id)}>Delete</button>
                </td>
              </tr>
            );
          })}
        </table>
      </div>
    )}
  </div>
  );
};

export default AddToCart;
